import React from 'react';
import "./Header.css";
// import 'bootstrap/dist/css/bootstrap.min.css';
// import { img_300 , unavailable } from "../../config/config";
import Carousel from "react-material-ui-carousel";
import images1 from "../../images/images.jpg";
import images2 from "../../images/tải xuống.jpg";
import images3 from "../../images/thuat-ngu-dien-anh-02-33c96a.jpg";
const Header = ({
  title,
}) => {
  return (
    <span onClick={() => window.scroll(0, 0)} className="header">
     <Box my={5} display="flex" alignContent="center" justifyContent="center">
        <Box width="100vh">
          <Carousel
            animation={"slide"}
            timeout={500}
            indicators={false}
            className={classes.carousel}
          >
            {slideItems.map((item) => (
              <Paper key={item.title}>
                <Image src={item.media} aspectRatio={16 / 9} />
              </Paper>
            ))}
          </Carousel>
        </Box>
      </Box>
    </span>

  );
};

export default Header;
